void panel_draw(Display *display, int meters, int score) {
	int x,y;
	char buffer[255];
	for(x = 0; x < 120; x++)
		for(y = 0; y < 30; y++) {
			//display->back_buffer[x+2][y+96] = ((panel[y*120 + x] & 0xE0) << 2 * 8) | ((panel[y*120 + x] & 0x1c) << 1 * 8) | (panel[y*120 + x] & 0x03 << 0 * 8);
			display->back_buffer[x+2][y+96] = (panel[(y * 120 + x) * 4] << 0 * 8) | (panel[(y*120 + x) * 4 +1] << 1 * 8) | (panel[((y*120 + x ) * 4 ) + 2] << 2 * 8);
		}	
	GrContextBackgroundSet(&display->sContext, 0xbf8f3c);
	GrContextForegroundSet(&display->sContext, 0x000000);
	GrStringDraw(&display->sContext, "01", -1, 17+2, 20+96, true);
		
	sprintf(buffer, "%05d", meters /10);
	GrStringDraw(&display->sContext, buffer, -1, 67+2, 4+96, true);
	GrContextBackgroundSet(&display->sContext, 0x000000);
	GrContextForegroundSet(&display->sContext, 0xbf8f3c);
	sprintf(buffer, "%d", meters %10);
	GrStringDraw(&display->sContext, buffer, -1, 98+2, 4+96, true);
	
	GrContextBackgroundSet(&display->sContext, 0xbf8f3c);
	GrContextForegroundSet(&display->sContext, 0x000000);		
	sprintf(buffer, "%03d", score);
	GrStringDraw(&display->sContext, buffer, -1, 84+2, 4+111, true);
}